import React from 'react';
import { Button } from './Button';
import '../App.css';
import './Main.css';


function Main() {
    return (
        <div className="bg-[blue]">
            <div className="">
                <h1>Hi! I'm Dev Patel</h1>
                <p>
                    Computer Science | Business | UNC
                </p>
                <Button buttonStyle='btn--primary' buttonSize='btn--large'>
                    DISCOVER MORE
                </Button>
            </div>
        </div>
    )
}

export default Main
